import React, { Component } from 'react';
import axios from 'axios'

class Api extends Component {
    state = { 
        userData: []
     }

    componentDidMount() {
        axios.get('https://jsonplaceholder.typicode.com/users')
        .then(response => {
            // console.log(response)
            this.setState({
                userData: response.data
            })
            // console.log(this.state.userData[0].address)
            // console.log(this.state.userData[0])
            // let address = this.state.userData[0].name
            // console.log(address.geo.lat)
        })
        .catch(error => {
            console.log(error)
        })
    }

    render() { 
        const baal = this.state.userData[0]
        return ( 
            <div>
                <h2>Name: {baal}</h2>
            </div>
         );
    }
}

export default Api;
